import { createSlice } from '@reduxjs/toolkit'

export const carItemSlicer = createSlice({
    name: "car",
    initialState: { value: [] },
    reducers: {
        addCar: (state, action) => {
            state.value = action.payload
        },
    },
})
export const { addCar } = carItemSlicer.actions
export default carItemSlicer.reducer
